import React from "react";
import { Stack } from "@mui/material";
import { Link } from "react-router-dom";
import Logo from "../assets/images/Logo.png";
import UserWorkoutPlan from "./UserWorkoutPlan";
import Navbar from "./Navbar";

import dayjs from "dayjs";
import { AdapterDayjs } from "@mui/x-date-pickers/AdapterDayjs";
import { LocalizationProvider } from "@mui/x-date-pickers/LocalizationProvider";
import { StaticDatePicker } from "@mui/x-date-pickers/StaticDatePicker";
import Box from "@mui/material/Box";
import SpeedDial from "@mui/material/SpeedDial";
import SpeedDialIcon from "@mui/material/SpeedDialIcon";
import SpeedDialAction from "@mui/material/SpeedDialAction";

import SelfImprovementIcon from "@mui/icons-material/SelfImprovement";
import FitnessCenterIcon from "@mui/icons-material/FitnessCenter";
import DirectionsRunIcon from "@mui/icons-material/DirectionsRun";

const actions = [
  { icon: <SelfImprovementIcon />, name: "Stretch" },
  { icon: <FitnessCenterIcon />, name: "Straight" },
  { icon: <DirectionsRunIcon />, name: "Cardio" },
];

function WorkoutTracker() {
  return (
    <Stack>
      <Navbar />
      <div className="calendar">
        <LocalizationProvider dateAdapter={AdapterDayjs}>
          <StaticDatePicker
            sx={{
              bgcolor: "#2b627a",

              boxShadow: 4,
              color: "white",
            }}
            displayStaticWrapperAs="desktop"
            defaultValue={dayjs("")}
            slotProps={{
              toolbar: { toolbarFormat: "ddd DD MMMM", hidden: false },
            }}
          />
          <Box sx={{ height: 10, transform: "translateZ(0px)", flexGrow: 1 }}>
            <SpeedDial
              className="speeddial"
              ariaLabel="SpeedDial basic example"
              sx={{
                position: "fixed",
                bottom: 16,
                right: 16,
              }}
              icon={<SpeedDialIcon />}
            >
              {actions.map((action) => (
                <SpeedDialAction
                  key={action.name}
                  icon={action.icon}
                  tooltipTitle={action.name}
                />
              ))}
            </SpeedDial>
          </Box>
        </LocalizationProvider>
      </div>
      <Box
        sx={{
          display: "flex",
          flexWrap: "wrap",
        }}
      >
        <UserWorkoutPlan />
      </Box>
    </Stack>
  );
}

export default WorkoutTracker;
